    `Profile_URL` VARCHAR(56) CHARACTER SET utf8,
    `Signal` INT,
    `Location` VARCHAR(22) CHARACTER SET utf8,
    `Market` VARCHAR(42) CHARACTER SET utf8,
    `Website` VARCHAR(42) CHARACTER SET utf8,
    `Employees` VARCHAR(19) CHARACTER SET utf8,
    `Stage` VARCHAR(8) CHARACTER SET utf8,
    `Total_Raised` INT,
    `Joining_Month` VARCHAR(4) CHARACTER SET utf8,
